static nnom_model_t* nnom_model_create(void)
{
	static nnom_model_t model;
	nnom_layer_t* layer[11];

	new_model(&model);

	layer[0] = Input(shape(28, 28, 1), nnom_input_data);
	layer[1] = model.hook(Conv2D(28, kernel(3, 3), stride(1, 1), dilation(1, 1), PADDING_VALID, &conv2d_16_w, &conv2d_16_b), layer[0]);
	layer[2] = model.hook(MaxPool(kernel(2, 2), stride(2, 2), PADDING_VALID), layer[1]);
	layer[3] = model.hook(Conv2D(24, kernel(3, 3), stride(1, 1), dilation(1, 1), PADDING_VALID, &conv2d_17_w, &conv2d_17_b), layer[2]);
	layer[4] = model.hook(MaxPool(kernel(2, 2), stride(2, 2), PADDING_VALID), layer[3]);
	layer[5] = model.hook(Conv2D(7, kernel(3, 3), stride(1, 1), dilation(1, 1), PADDING_VALID, &conv2d_18_w, &conv2d_18_b), layer[4]);
	layer[6] = model.hook(MaxPool(kernel(2, 2), stride(2, 2), PADDING_VALID), layer[5]);
	layer[7] = model.hook(Flatten(), layer[6]);
	layer[8] = model.hook(Dense(96, &dense_10_w, &dense_10_b), layer[7]);
	layer[9] = model.hook(Dense(10, &dense_11_w, &dense_11_b), layer[8]);
	layer[10] = model.hook(Output(shape(10,1,1), nnom_output_data), layer[9]);
	model_compile(&model, layer[0], layer[10]);
	return &model;
}
